import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';
import Navbar from './components/Navbar';
import LandingPage from './pages/LandingPage';
import Login from './pages/auth/Login';
import Register from './pages/auth/Register';
import Dashboard from './components/patient/Dashboard';
import PractitionerDashboard from './components/practitioner/Dashboard';
import BookAppointment from './pages/patient/BookAppointment';
import TreatmentHistory from './pages/patient/TreatmentHistory';
import Profile from './pages/patient/Profile';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Routes>
            {/* Public Routes */}
            <Route path="/" element={<LandingPage />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />

            {/* Protected Routes */}
            <Route path="/dashboard" element={
              <ProtectedRoute>
                <Navbar />
                <Dashboard />
              </ProtectedRoute>
            } />

            <Route path="/practitioner-dashboard" element={
              <ProtectedRoute>
                <Navbar />
                <PractitionerDashboard />
              </ProtectedRoute>
            } />

            <Route path="/book-appointment" element={
              <ProtectedRoute>
                <Navbar />
                <BookAppointment />
              </ProtectedRoute>
            } />

            <Route path="/treatment-history" element={
              <ProtectedRoute>
                <Navbar />
                <TreatmentHistory />
              </ProtectedRoute>
            } />

            <Route path="/profile" element={
              <ProtectedRoute>
                <Navbar />
                <Profile />
              </ProtectedRoute>
            } />

            {/* Redirect unknown routes to landing page */}
            <Route path="*" element={<Navigate to="/" replace />} />
          </Routes>
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
